import MainPage from "./pages/MainPage";
import { BrowserRouter } from "react-router-dom";
function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route
          path={'/'}
          element={<MainPage />}
        />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
